import React from 'react'
import { useSelector } from 'react-redux';

function card() {
  const movie = useSelector((state) => state.MovieData.movies);
  return (
    <div> 
      {
        movie.map((ele)=>(
          <span className='movie_title'>{ele.title}</span>
        ))
      }
    </div>
  )
}

export default card
